import React from "react";

const Note = ({ title, content, props }) => {
  const deleteHandler = () => {
    title.onDelete(title.id);
    content.onDelete(content.id);
  };
  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick={deleteHandler}>Delete</button>
    </div>
  );
};
export default Note;
